import math

training_until=10

simple_alpha=True#False

def get_c_alpha(ll):
    
    if simple_alpha:
    
        nom=0.
        den=0.
        for (l, dim) in ll:
            nom += math.log2(l)*dim
            den += dim*dim
        return (0, nom/den)       

    else:

        sum_yi=0.
        sum_xi=0.
        sum_xi2=0.
        sum_xi_yi=0.
        
        for (l, dim) in ll:
            sum_yi += math.log2(l)
            sum_xi+=dim
            sum_xi2+=dim*dim
            sum_xi_yi+=math.log2(l)*dim

        a = (sum_yi*sum_xi2-sum_xi*sum_xi_yi)/(len(ll)*sum_xi2-sum_xi*sum_xi)
        b = (len(ll)*sum_xi_yi-sum_xi*sum_yi)/(len(ll)*sum_xi2-sum_xi*sum_xi)
    
    return (a,b)

